const Pager = ({ gamesPerPage, allGames, paginado }) => {
  const pageNumber = [];

  for (let i = 0; i <= Math.ceil(allGames / gamesPerPage); i++) {
    pageNumber.push();
  }

  return (
    <nav>
      <ul>
        {pageNumber &&
          pageNumber.map((number) => {
            <li>
              <a onClick={() => paginado(number)}>{number}</a>;
            </li>;
          })}
      </ul>
    </nav>
  );
};

export default Pager;
